INSERT INTO `anime` VALUES (NULL,NULL,12,NULL,NULL,12,NULL,'00:00','2025-08-24 05:22:25.272406',1,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.255980','','브리지','','https://img.duckstar.kr/animes/1/main.webp','https://img.duckstar.kr/animes/1/thumb.webp','학원, 코미디, 백합',NULL,'배드 걸','ばっどがーる','SUN','TVA','{\"X\": \"https://twitter.com/badgirl_anime\", \"OTHERS\": \"https://badgirl-anime.com/\"}','ENDED','날카로운 눈초리에 커다란 피어스. 그리고 화려함의 극치를 달리는 투톤 헤어의 고등학교 1학년 학생, 유우타니 유우 그녀는 누구나 길을 비키는 악명 높은 불량아(배드 걸)...가 아니다. 근본은 너무나도 착한 아이인 유우의 머릿속은 언제나 학원의 마돈나, 미즈토리 아토리로 가득하다. 선도부장을 맡고 있는 아토리의 관심을 끌고 싶은 유우는 우등생을 그만두고 \'나쁜 불량아\'를 목표로 하는데! 나쁜 척하지만 전혀 나쁘지 않다고?? 자칭 불량아에 조금 바보 같은 소녀의 분투를 그리는 학원 코미디, 개학(스타트)!!'),(NULL,NULL,15,NULL,NULL,12,NULL,'00:00','2025-08-24 05:22:25.285602',2,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256115','스이게츠','Felix Film','타마다 히로시','https://img.duckstar.kr/animes/2/main.webp','https://img.duckstar.kr/animes/2/thumb.webp','판타지',NULL,'용사 파티에 추방된 백마도사, S랭크 모험자에게 주워지다','勇者パーティーを追放された白魔導師, Sランク冒険者に拾われる','SUN','TVA','{\"X\": \"https://twitter.com/tsuiho_anime\", \"OTHERS\": \"https://tsuiho-shiromadoshi.com/\"}','ENDED',NULL),(NULL,NULL,15,NULL,NULL,12,NULL,'00:00','2025-08-24 05:22:25.292230',3,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256181','후쿠다 신이치','Clover Works','시노하라 케이스케','https://img.duckstar.kr/animes/3/main.webp','https://img.duckstar.kr/animes/3/thumb.webp','로맨스, 코미디, 코스프레',NULL,'그 비스크 돌은 사랑을 한다 시즌 2','その着せ替え人形は恋をする Season 2','SUN','TVA','{\"X\": \"https://twitter.com/kisekoi_anime\", \"OTHERS\": \"https://bisquedoll-anime.com/\"}','ENDED',NULL),(NULL,NULL,12,NULL,NULL,12,NULL,'00:30','2025-08-24 05:22:25.299194',4,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256213','미카미 사카','Clover Works','쿠로키 미유키, 야마구치 사토시','https://img.duckstar.kr/animes/4/main_v2.webp','https://img.duckstar.kr/animes/4/thumb.webp','로맨스, 코미디, 학원',NULL,'향기로운 꽃은 늠름하게 핀다','薫る花は凛と咲く','SUN','TVA','{\"X\": \"https://twitter.com/kaoruhana_anime\", \"OTHERS\": \"https://kaoruhana-anime.com/\", \"INSTAGRAM\": \"https://www.instagram.com/kaoruhana.anime\"}','ENDED','위협적인 외모 때문에 오해를 받는 린타로와 그런 린타로를 스스럼없이 대하는 카오루코. 우연히 알게 된 두 사람은 서로 가까워지지만, 이웃해 있는 둘의 고등학교는 서로를 철저히 혐오한다.'),(NULL,NULL,15,NULL,NULL,12,NULL,'00:55','2025-08-24 05:22:25.305858',5,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256242','','CygamesPictures','타케시타 료헤이','https://img.duckstar.kr/animes/5/main.webp','https://img.duckstar.kr/animes/5/thumb.webp','공포, 드라마, 청춘, 서스펜스',NULL,'히카루가 죽은 여름','光が死んだ夏','SUN','TVA','{\"X\": \"https://twitter.com/hikanatsu_anime\", \"OTHERS\": \"https://hikanatsu-anime.com/\"}','ENDED','시골 일본 마을에 사는 두 명의 절친 요시키와 히카루를 따라간다. 함께 자라면서 그들은 떨어질 수 없다. 히카루가 산에서 돌아와 더 이상 자신이 아니게 된 날까지. 뭔가가 히카루의 몸, 기억, 감정을 장악했고, 그들이 아는 모든 것이 풀리기 시작한다.'),(NULL,NULL,15,NULL,NULL,12,NULL,'01:30','2025-08-24 05:22:25.313231',6,'2025-06-29 00:00:00.000000','2025-09-21 22:00:03.256271','나나노 리쿠','스튜디오 블랑','나가야마 노부요시','https://img.duckstar.kr/animes/6/main.webp','https://img.duckstar.kr/animes/6/thumb.webp','판타지',NULL,'공녀 전하의 가정교사','公女殿下の家庭教師','SUN','TVA','{\"X\": \"https://twitter.com/koujo_anime\", \"OTHERS\": \"https://koujodenka-anime.com/\"}','ENDED','왕궁 마법사 시험에 떨어지고 일거리를 찾던 앨런에게 공녀 전하의 가정교사 일이 날아온다. 일을 대수롭지 않게 생각하려던 참에 그를 기다리고 있던 것은 마법을 전혀 사용하지 못하는 공녀 전하, 티나였다.'),(NULL,NULL,12,NULL,NULL,12,NULL,'01:30','2025-08-24 05:22:25.321147',7,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256300','','','야마나시 토모히로','https://img.duckstar.kr/animes/7/main.webp','https://img.duckstar.kr/animes/7/thumb.webp','일상, 드라마',NULL,'비와 너와','雨と君と','SUN','TVA','{\"X\": \"https://twitter.com/amekimi_anime\", \"OTHERS\": \"https://amekimi-anime.com/\"}','ENDED','어느 비 오는 날에, 한 사람과 한 마리는 만났습니다.\n흠뻑 젖어 집에 가는 길, 후지는 조금 특이한 \'개\'와 만난다.\n\n개는 흰 종이 카드를 써서 \'데려가 주세요\'라며 어필하고,\n후지에게 접이식 우산을 건넨다.\n\n근데 이 개, 특이하다기보단....?\n\n아무 일도 없는 평범한 일상에 나타난 조금은 희한한 친구.\n함께 사계절을 보내며 먹고, 산책하고, 수다(?)도 떨고...\n\n\'조금만 더\'가 포근하고 사랑스러운\n한 사람과 한 마리의 아마도, 사이 좋은 동거 생활.'),(NULL,NULL,15,NULL,NULL,12,NULL,'16:30','2025-08-24 05:22:25.330159',8,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256328','아이다 이로','','','https://img.duckstar.kr/animes/8/main.webp','https://img.duckstar.kr/animes/8/thumb.webp','귀신, 능력, 모험, 미스테리, 코미디, 공포',NULL,'지박소년 하나코 군 2 (2025)','地縛少年花子くん2 (2025)','SUN','TVA','{\"X\": \"https://twitter.com/hanakokun_info\", \"OTHERS\": \"https://hanakokun.com/2nd/\"}','ENDED','저기, 알고 있니? 카모메 학원의 7대 불가사의, 7번째 소문. 구교사 3층 여자 화장실. 거기엔 하나코 씨가 있는데, 무언가 하나를 대가로 자신을 불러낸 사람의 소원을 이루어 준대. 불러내는 방법은 노크 세 번. 그리고-- \'하나코 씨, 하나코 씨, 계세요?\' 7대 불가사의 7번째 \'화장실의 하나코 씨\'인 \'하나코 군\'과 인연을 맺은 소녀, 야시로 네네. 퇴마사 가문의 소년 미나모토 코우. 두 사람은 하나코 군과 함께 소문이 바뀌어 버린 7대 불가사의와 괴이들의 소문을 원래대로 되돌리기 위해 매일 분투하며 뛰어다니고 있다. 7대 불가사의 \'세 명의 시계지기\' 때문에 벌어진 트러블과 \'미술실의 시지마 씨\'가 창조한 가짜 세계에서의 탈출을 거쳐 네네는 자신의 수명에 대한 진실을 알게 되었다. 혼란스러웠지만 카모메 학원의 전통 행사인 숙박 학습에 참가하게 된다. 누구에게도 들리지 않는 피리 소리... 잠자는 사람의 영혼을 취하러 오는 사신의 소문... 새로운 7대 불가사의와 함께, 다시 한번 이야기는 움직이기 시작한다--.'),(NULL,NULL,12,NULL,NULL,12,NULL,'17:30','2025-08-24 05:22:25.340055',9,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256357','마에다 군','토호','이베 유시','https://img.duckstar.kr/animes/9/main.webp','https://img.duckstar.kr/animes/9/thumb.webp','개그, 로맨스, 코미디',NULL,'푸니르는 귀여운 슬라임 (2025)','ぷにるはかわいいスライム (2025)','SUN','TVA','{\"X\": \"https://twitter.com/PUNIRUcorocoro\", \"OTHERS\": \"https://puniru-anime.com/\"}','ENDED','중학생 코타로는 아닌 척하지만 사실 귀여운 슬라임을 만드는 것을 좋아한다. 그러던 어느 날, 몇 년 전 만들었던 슬라임 푸니르가 여자아이의 모습으로 나타나고, 코타로는 푸니르의 자유분방한 말과 행동에 휘말린다.'),(NULL,NULL,12,NULL,NULL,12,NULL,'21:30','2025-08-24 05:22:25.350012',10,'2025-07-06 00:00:00.000000','2025-09-21 22:00:03.256389','','스튜디오 바인드','후지이 신고','https://img.duckstar.kr/animes/10/main.webp','https://img.duckstar.kr/animes/10/thumb.webp','과학, 모험',NULL,'루리의 보석','瑠璃の宝石','SUN','TVA','{\"X\": \"https://twitter.com/rurinohouseki\", \"OTHERS\": \"https://rurinohouseki.com/\"}','ENDED',NULL),(NULL,NULL,15,NULL,NULL,12,NULL,'22:30','2025-08-24 05:22:25.358155',11,'2025-07-06 00:00:00.000000','2025-08-24 05:22:25.358155','','Maho Film','','https://img.duc