 눈 깜짝할 사이에 20년이 지나고, 그 과정에서 마주칠 때마다 그는 인간 마법의 정점에 한 걸음 더 가까워집니다. 그는 그것이 자신의 이야기의 첫 장일 뿐이라는 사실을 거의 깨닫지 못합니다. 운명적인 만남은 곧 료를 역사의 최전선으로 밀어내어 인생의 흐름을 영원히 바꿉니다...\n\n이렇게 해서 세계에서 가장 강력한 물 마술사의 모험이 시작됩니다. 그는 또한 자신의 속도에 맞춰 일을 하는 것을 좋아합니다!'),(NULL,NULL,12,NULL,NULL,12,NULL,'22:30','2025-08-24 05:22:25.617676',49,'2025-07-04 00:00:00.000000','2025-09-21 22:00:03.260578','','실버 링크','미나토 미라이','https://img.duckstar.kr/animes/49/main.webp','https://img.duckstar.kr/animes/49/thumb.webp','학원, 로맨스, 코미디',NULL,'못난이에게 꽃다발을','ブスに花束を。','FRI','TVA','{\"X\": \"https://twitter.com/busunihanataba\", \"OTHERS\": \"https://busunihanatabawo.com/\"}','ENDED',NULL),(NULL,NULL,15,NULL,NULL,12,NULL,'23:00','2025-08-24 05:22:25.623470',50,'2025-07-11 00:00:00.000000','2025-08-24 05:22:25.623470','','라르케','','https://img.duckstar.kr/animes/50/main.webp','https://img.duckstar.kr/animes/50/thumb.webp','다크 판타지',NULL,'도원암귀','桃源暗鬼','FRI','TVA','{\"X\": \"https://twitter.com/tougenanki_anm\", \"OTHERS\": \"https://tougenanki-anime.com/\"}','NOW_SHOWING','오니와 모모타로의 혈통은 특정 인간들 사이에서 여러 세대에 걸쳐 전해졌습니다. 오래전, 오니는 자신의 잔인함을 알고 은둔 생활을 했습니다. 그러나 그들의 평화는 모모타로의 침략으로 깨졌습니다. 수천년에 걸쳐 이 두 세력은 각각 모모타로 기관과 오니 기관을 형성했으며 그 이후로 계속 갈등을 겪고 있습니다. 주인공 이치노세 시키는 예상치 못한 모모타로의 공격을 받고 갑자기 자신의 오니 혈통을 알게 된다. 이 계시는 시키에게 자신의 피 속에 있는 운명, 즉 자신 안에 살고 있는 오니와의 만남을 발견할 수 있는 길을 제시합니다. — 이 악마의 이야기에서 새로운 세대의 어둠의 영웅이 시작됩니다!'),(NULL,NULL,15,NULL,NULL,12,NULL,'23:30','2025-08-24 05:22:25.629421',51,'2025-07-04 00:00:00.000000','2025-09-21 22:00:03.260611','Hypergryph, Studio Montagne','Yostar Pictures','','https://img.duckstar.kr/animes/51/main.webp','https://img.duckstar.kr/animes/51/thumb.webp','SF, 판타지, 액션',NULL,'명일방주: 잿더미 속 불빛','アークナイツ 焔燼曙明','FRI','TVA','{\"X\": \"https://twitter.com/ArknightsStaff\", \"OTHERS\": \"https://2nd.arknights-anime.jp/\"}','ENDED','테라의 대지에서는 원인불명의 재해가 각지에서 불규칙하게 발생하고 있다. 그곳의 대다수의 사람들은 재해로부터 도망치기 위해 긴 세월을 거쳐 개발된 이동 도시에서 살게 되었다. 재해가 지나간 땅에 남겨진 막대한 에너지를 가진 원석은 문명의 비약적인 진보를 가져다준 한편, 치료가 불가능한 병, 광석병을 가져 왔다. 광석병 감염자는 서서히 몸이 결정화