'청춘 돼지는 산타클로스의 꿈을 꾸지 않는다','青春ブタ野郎はサンタクロースの夢を見ない','SAT','TVA','{\"X\": \"https://twitter.com/aobuta_anime\", \"OTHERS\": \"https://ao-buta.com/\"}','ENDED','사춘기 증후군-- 불안정한 정신 상태 때문에 일어나는 소문의 불가사의한 현상. 고교 시절 다양한 사춘기 증후군이 발병한 소녀들과 만난 \'아즈사가와 사쿠타\'도 대학생이 되었다. 국민적 인기 여배우이자 연인인 \'사쿠라지마 마이\'와 함께 카나자와핫케이에 있는 대학에 진학한 사쿠타는, 교내에서 계절과 맞지 않는 미니 스커트를 입은 산타를 발견했다. 놀랐어. 너한텐 내가 보이는 구나. 어딘가에서 들어본 것 같은 대사. 사춘기 증후군을 선물하고 있다고 말하는 미니 스커트 산타는 사쿠타에게 말했다. ...내 이름은 키리시마 토코야. SNS에서 유행하는 예지몽, 정체불명의 인터넷 가수, 폴터가이스트, 수수께끼의 현상과 함께, 방황하는 소녀들과의 불가사의한 이야기가 다시 시작된다. 사춘기는 끝나지 않는다--'),(NULL,NULL,15,NULL,NULL,NULL,NULL,NULL,NULL,65,'2025-08-22 00:00:00.000000',NULL,'고토게 코요하루','ufotable','소토자키 하루오','https://img.duckstar.kr/animes/65/main.webp','https://img.duckstar.kr/animes/65/thumb.webp','시대극 판타지, 액션','Demon Slayer: Kimetsu No Yaiba The Movie: Infinity Castle','극장판 귀멸의 칼날: 무한성편','劇場版「鬼滅の刃」無限城編 第一章 猗窩座再来',NULL,'MOVIE',NULL,'NOW_SHOWING',NULL);
